import React from 'react'
import {connect} from 'react-redux'
import {Grid, Card, CardHeader, CardContent ,Button} from '@material-ui/core'
import {GetGenre, PostActiveGenre, GetMovieGenre} from '../../redux/actions/movie'
import { makeStyles, useTheme } from '@material-ui/core/styles';
import axios from 'axios'
import colors from '../../tools/colors';

const useStyles = makeStyles(theme => ({
    cardLogin : {
        width : 400,
        position : 'absolute',
        top: '50%',
        left: '50%',
        transform : 'translate(-50%, -50%)'
    }
}));

const Login = () => {
    const classes = useStyles();
    const theme = useTheme();
    return (
        <>
            <Card className={classes.cardLogin}>
                <CardHeader>
                    <h4 className="head-login">Masuk ke {process.env.APP_NAME}</h4>
                </CardHeader>
                <CardContent>

                </CardContent>
            </Card>
            <style jsx>{`
                .head-login {
                    font-family: Poppins;
                    font-size: 16px;
                    font-color: ${colors.blackPrimary};
                    text-align: center;
                }

            `}</style>
        </>
    )
}
const mapStateToProps = (state) => ({
    auth : state.auth
})

export default connect(mapStateToProps)(Login)
